Quando uma pessoa mora no exterior e deseja investir na Magnetis, ela pode se enquadrar em uma das situações a seguir:

Mora no exterior há menos de 12 meses seguidos ou ainda mantém a condição de residente no Brasil: nesse caso, o processo de investir com a Magnetis é como investir em qualquer outra aplicação financeira no Brasil. Basta montar o plano de investimentos em nosso site e seguir os passos indicados. As aplicações poderão ser feitas e acompanhadas a qualquer momento, de qualquer lugar;


Mora no exterior há mais de 12 meses seguidos ou já fez uma declaração de saída definitiva do Brasil: nesse caso, a pessoa possui o mesmo tratamento de estrangeiros e não pode abrir uma conta bancária em seu nome no Brasil.

